import React, { Component } from 'react';

class test extends Component{
    constructor(){
        super();
        this.state={

            monsters:[
                {
                    name:'raunak',
                    id:'1'
                },
                {
                    name:'punit',
                    id:'2'
                },
                {
                    name:'pranav',
                    id:'3'
                }
            ]
        };
    }

    render(){
        return(
            <div>
            {
            this.state.monsters.map(monsters => <h1>{ monsters.name}</h1>)
        }
            </div>
        )
    }
}

